import 'whatwg-fetch'

const request = require('request');

const options = {
  url: 'http://localhost:3000/api/earthquakes',
   headers: {
      'Content-Type': 'application/json',
      Accept: 'application/json',
    },
};

export async function Get(params) {
  fetch('http://localhost:3000/api/earthquakes').then(response => {
    return response.json();
  }).then(data => {
    console.log(data);
  }).catch(err => {
    console.warn(err)
  });
}

async function getJson(response) {
  response = await response.json();
  return response;
}
